import React, {Component} from 'react'
import {Form} from 'antd'

/*
管理-统计
 */
export default class AddForm extends Component{

    render(){
        return(
            <Form>
                <Item>
                    {
                        getFieldDecorator('categoryName', {
                            initialValue:'',
                            rules: [{required: true, message:''}]
                        })
                    }
                </Item>
            </Form>
        )
    }
}
